import React from "react";

function Nav() {
  return (
    <div className="nav">
      <img
        className="nav__logo"
        src="https://upload.wikimedia.org/wikipedia/commons/0/0f"
        alt="Netflix Logo"
      />

      <img
        className="nav__avatar"
        src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.behance.net%2Fgallery%2F33850498%2FNetflix-Profile-Avatars&psig=AOvVaw2hUJ4F9LhIxvNXhub7wzAX&ust=1596285332706000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCOC60bPA9-oCFQAAAAAdAAAAABAO"
        alt="Netflix Logo"
      />
    </div>
  );
}

export default Nav;
